import{_ as e,o as a,c as t,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 18.2-313.2 Introduction of snakehead fish or zebra mussel; penalty.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-313.2.md","filePath":"vacode/18.2-313.2.md"}'),r={name:"vacode/18.2-313.2.md"},s=o('<h1 id="§-18-2-313-2-introduction-of-snakehead-fish-or-zebra-mussel-penalty" tabindex="-1">§ 18.2-313.2 Introduction of snakehead fish or zebra mussel; penalty. <a class="header-anchor" href="#§-18-2-313-2-introduction-of-snakehead-fish-or-zebra-mussel-penalty" aria-label="Permalink to &quot;§ 18.2-313.2 Introduction of snakehead fish or zebra mussel; penalty.&quot;">​</a></h1><p>Any person who knowingly introduces into state waters any snakehead fish of the family Channidae, or knowingly places or causes to be placed into state waters any zebra mussel (Dreissena polymorpha) or the larvae thereof, without a permit from the Director of Wildlife Resources issued pursuant to § <a href="/vacode/29.1-575/">29.1-575</a> is guilty of a Class 1 misdemeanor.</p><p>2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0916" target="_blank" rel="noreferrer">916</a>; 2017, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0361" target="_blank" rel="noreferrer">361</a>.</p>',3),n=[s];function i(l,c,d,h,f,_){return a(),t("div",null,n)}const m=e(r,[["render",i]]);export{u as __pageData,m as default};
